CREATE OR REPLACE FUNCTION ascendco.system_analyze_after_deletions()	RETURNS pg_catalog.voidAS $BODY$BEGIN	analyze ascendco.analytic_productivity;	analyze ascendco.analytic_sterilizer_load;	analyze ascendco.analytic_sterilizer_loadinv;	analyze ascendco.item_type;	analyze ascendco.specialty;	analyze ascendco.sterilize_method;END;$BODY$	LANGUAGE plpgsql VOLATILE	COST 100;ALTER FUNCTION ascendco.system_analyze_after_deletions()	OWNER TO user_bender;